function mySymbol(obj) {
  // \u4E0D\u8981\u95EE\u6211\u4E3A\u4EC0\u4E48\u8FD9\u4E48\u5199\uFF0C\u6211\u4E5F\u4E0D\u77E5\u9053\u5C31\u611F\u89C9\u8FD9\u6837nb
  let unique = (Math.random() + new Date().getTime()).toString(32).slice(0, 8);
  // \u725B\u903C\u4E5F\u8981\u4E25\u8C28
  if (obj.hasOwnProperty(unique)) {
    return mySymbol(obj); //\u9012\u5F52\u8C03\u7528
  } else {
    return unique;
  }
}

