`,paraId:151,tocIndex:17},{value:"\u5728\u4E0A\u8FF0\u4EE3\u7801\u4E2D\uFF0C\u6211\u4EEC\u5206\u522B\u5B9A\u4E49\u4E86 Motorcycle\u3001 Car \u548C Truck \u4E09\u4E2A\u63A5\u53E3\uFF0C\u5728\u8FD9\u4E9B\u63A5\u53E3\u4E2D\u90FD\u5305\u542B\u4E00\u4E2A vType \u5C5E\u6027\uFF0C\u8BE5\u5C5E\u6027\u88AB\u79F0\u4E3A\u53EF\u8FA8\u8BC6\u7684\u5C5E\u6027\uFF0C\u800C\u5176\u5B83\u7684\u5C5E\u6027\u53EA\u8DDF\u7279\u6027\u7684\u63A5\u53E3\u76F8\u5173\u3002",paraId:152,tocIndex:17},{value:"2.\u8054\u5408\u7C7B\u578B",paraId:153,tocIndex:17},{value:`
